$templateCache.put('templates/chiSiamoContent.html','<update-title title="Annacloud.it - Chi Siamo"></update-title><update-meta http-equiv=Content-Language content=es></update-meta><update-meta name=description content="Annacloud nasce dall\u2019incontro tra tradizione e innovazione e dall\u2019interpretazione in chiave digitale e social di tutto il processo di creazione di una borsa da donna."></update-meta><update-meta property=og:title content="Annacloud.it - Chi Siamo"></update-meta><update-meta property=og:description content="Annacloud nasce dall\u2019incontro tra tradizione e innovazione e dall\u2019interpretazione in chiave digitale e social di tutto il processo di creazione di una borsa da donna."></update-meta><update-meta itemprop=description content="Annacloud nasce dall\u2019incontro tra tradizione e innovazione e dall\u2019interpretazione in chiave digitale e social di tutto il processo di creazione di una borsa da donna."></update-meta><update-script content=structuredData type=application/ld+json></update-script><div class=contatti-content><div class="container-fluid text-justify"><div class="row narrazione"><div class="col-sm-6 no-padding no-margin clearfix bottom-buffer wow fadeInUpSmall visible-xs" data-wow-delay=.2s style="background: url(images/team-img-2-bg.jpg) center center no-repeat; background-size: cover; background-color: #fff"><img src=images/team-img-2-bg.jpg class="hidden visible-xs"></div><div class="col-sm-6 no-padding no-margin clearfix bottom-buffer wow fadeInUpSmall" data-wow-delay=.2s><div class=content><h3 style="font-weight: lighter" class=text-center>Chi siamo</h3><p class=text>Anna Cloud nasce dalla passione di due giovanissimi imprenditori toscani, Andrea e Luca, che hanno deciso di cambiare le regole dell\u2019alta moda ideando un nuovo concept di pelletteria.</p><p class=text>Questa visione nasce dall\u2019incontro tra tradizione e innovazione e dall\u2019interpretazione in chiave digitale e social di tutto il processo di creazione di una borsa da donna.</p><p class=text>La parte produttiva \xE8 gestita interamente \u201Cin casa\u201D. Luca, infatti, \xE8 pellettiere da due generazioni, gi\xE0 fornitore di prodotti di altissima fattura per le pi&ugrave; importanti firme..</p><p class=text>Ma come rendere un prodotto di alta qualit\xE0 economicamente accessibile? E soprattutto: come trasformare radicalmente l\u2019esperienza di acquisto?</p><p class=text>Qui entra in gioco la tecnologia, con un configuratore 3D realizzato su misura, capace di offrire un alto livello di personalizzazione e una qualit\xE0 foto-realistica dei prodotti. Il processo produttivo infine viene condiviso passo passo con il cliente che avr\xE0 il piacere e la consapevolezza di aver acquistato un oggetto unico.</p></div></div><div class="col-sm-6 no-padding no-margin clearfix bottom-buffer wow fadeInUpSmall hidden-xs" data-wow-delay=.2s style="background: url(images/team-img-2-bg.jpg) center center no-repeat; background-size: cover; background-color: #fff"><img src=images/team-img-2-bg.jpg class="hidden visible-xs"></div></div><div class=row style="min-height: 100px; background:#F6F6F6"><div class="col-sm-12 clearfix top-buffer home-content wow fadeInUpSmall"></div></div></div></div>');
